import {StyleSheet} from 'aphrodite';
const styles = StyleSheet.create({
    wrapper:{
        marginTop: '235px',
        width: "700px"
    },
    h:{
        fontFamily: 'SFUIDisplay-Medium',
        fontSize: '20px',
        fontWeight: 500,
        marginBottom: "50px"
    },
    t:{
        color: "#acacac",
        fontFamily: "SFUIDisplay-Light",
        fontSize: '15px',
        fontWeight: 300,
        lineHeight: "27px"
    }
});
export default styles;
